// client/src/pages/BookListPage.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { toast } from 'react-toastify';
import { useAuth } from '../contexts/AuthContext';
import { useNavigate } from 'react-router-dom';

function BookListPage() {
    const { user, isAuthenticated } = useAuth();
    const navigate = useNavigate();

    const [books, setBooks] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchBooks = async () => {
            try {
                setLoading(true);
                const { data } = await axios.get('/api/books');
                setBooks(data);
                setLoading(false);
            } catch (err) {
                console.error('Error fetching books:', err);
                setError('Failed to load books. Please try again later.');
                toast.error('Failed to load books.');
                setLoading(false);
            }
        };

        fetchBooks();
    }, []);

    const handleRequestExchange = (requestedBookId, ownerId, requestedBookTitle) => {
        if (!isAuthenticated) {
            toast.warn('Please log in to request an exchange.');
            navigate('/login');
            return;
        }
        if (user._id === ownerId) {
            toast.info('You cannot request an exchange for your own book.');
            return;
        }
        navigate(`/request-exchange?requestedBookId=${requestedBookId}&ownerId=${ownerId}&requestedBookTitle=${encodeURIComponent(requestedBookTitle)}`);
    };


    if (loading) {
        return <div className="text-center py-4">Loading books...</div>;
    }

    if (error) {
        return <div className="text-red-500 text-center py-4">Error: {error}</div>;
    }

    return (
        <div>
            <h1 className="text-3xl font-bold text-center mb-8">Available Books</h1>
            {books.length === 0 ? (
                <p className="text-center text-gray-600">No books are available for exchange at the moment. Be the first to add one!</p>
            ) : (
                <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
                    {books.map((book) => (
                        <div key={book._id} className="border border-gray-200 rounded-lg shadow-lg overflow-hidden flex flex-col">
                            <img src={book.imageUrl} alt={book.title} className="w-full h-48 object-cover" onError={(e) => { e.target.onerror = null; e.target.src = 'https://via.placeholder.com/150'; }} /> {/* Fallback image on error */}
                            <div className="p-4 flex-grow">
                                <h3 className="text-xl font-semibold mb-2">{book.title}</h3>
                                <p className="text-gray-700"><strong>Author:</strong> {book.author}</p>
                                <p className="text-gray-700"><strong>Genre:</strong> {book.genre || 'N/A'}</p>
                                <p className="text-gray-700"><strong>Condition:</strong> <span className="font-medium text-blue-600">{book.condition}</span></p>
                                <p className="text-gray-700"><strong>Owner:</strong> {book.owner ? book.owner.username : 'Unknown'}</p>
                                <p className="text-gray-600 text-sm mt-2 line-clamp-3">{book.description}</p> {/* line-clamp-3 for truncated description */}
                            </div>
                            {isAuthenticated && user && book.owner && user._id !== book.owner._id && (
                                <div className="p-4 border-t border-gray-200">
                                    <button
                                        onClick={() => handleRequestExchange(book._id, book.owner._id, book.title)}
                                        className="w-full bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline transition duration-150 ease-in-out"
                                    >
                                        Request Exchange
                                    </button>
                                </div>
                            )}
                        </div>
                    ))}
                </div>
            )}
        </div>
    );
}

export default BookListPage;
